import styled from 'styled-components';

export const BackgroundDiv = styled.div`
    color: #FFF4EA;
`;

export const TiraAzul = styled.div`
    display: flex;
    flex-direction: row;
    color: #90BDFF;
    height: 84px;
`;

export const Titulo = styled.h1`
width: 497px;
height: 69px;
left: 38px;
top: 46px;

font-family: 'Titan One';
font-style: normal;
font-weight: 400;
font-size: 64px;
line-height: 73px;

color: #90BDFF;

text-shadow: 0px 4px 4px rgba(0, 0, 0, 0.25);
`;
